import 'package:flutter/cupertino.dart';

const String _DEFAULT_IMAGE = "";

class ExerciseDto {
  final String name;
  final String image;
  final String videoUrl;
  final String repetitions;
  String description;
  int stepPosition;


  ExerciseDto({
    @required this.name,
    @required this.image,
    @required this.videoUrl,
    @required this.repetitions,
    this.description
  });

  bool defaultImage(){
    return image ==_DEFAULT_IMAGE;
  }

  setStepPosition(int stepPosition){
    this.stepPosition = stepPosition;
  }
}